import React ,{useEffect,useState}from 'react';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import ListSubheader from '@material-ui/core/ListSubheader';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Axios from"axios";

const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
    display:"flex",
    flexDirection:"row"

  },
}));


export default  function GroupedSelect() {

    const [city,setCity]= useState([]);
    const [prefucture,setPrefucture]=useState([]);
    const [cityForSearch,setCityForSearch]=useState("");

    useEffect(() => {
    ã€€Axios.get("https://opendata.resas-portal.go.jp/api/v1/prefectures",{
            headers:{"X-API-KEY":"JZ6Nzmm6F54YU3FD7RvDEZ1qUU9RgpbGF1GdkObS"}}).then((res)=>{
                const result=res.data.result
                result.map((val)=>{
                   setPrefucture(prev=>[...prev,val])})

                })            
        },[]);

  const classes = useStyles();

  const getCity=(code)=>{
    Axios.get(`https://opendata.resas-portal.go.jp/api/v1/cities?prefCode=${code}`,{
        headers:{"X-API-KEY":"JZ6Nzmm6F54YU3FD7RvDEZ1qUU9RgpbGF1GdkObS"}}).then((res)=>{
            const result=res.data.result
            setCity([]);
            result.map((val)=>{
                setCity(prev=>[...prev,val])})
        })
                     };

  return (
    <div>
      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="grouped-native-select">Grouping</InputLabel>
        <Select native defaultValue="" id="grouped-native-select" onChange={(e)=>{getCity(e.target.value)}}>
          <option aria-label="None" value="" />
          <optgroup label="Category 1">
                {prefucture.map((val)=>{
                    return(
                    <option value={val.prefCode}>{val.prefName}</option>)
                })}
          </optgroup>
          </Select>
          <InputLabel htmlFor="grouped-native-select">Grouping</InputLabel>
          <Select native defaultValue="" id="grouped-native-select" onChange={(e)=>{setCityForSearch(e.target.value)}}>
          <option aria-label="None" value="" />
          <optgroup label="Category 1">
                {city.map((val)=>{
                    return(
                    <option >{val.cityName}</option>)
                })}
          </optgroup>
          </Select>
          <Select native defaultValue="" id="grouped-native-select" onChange={(e)=>{setCityForSearch(e.target.value)}}>
          <option aria-label="None" value="" />
          <optgroup label="Category 1">
                {city.map((val)=>{
                    return(
                    <option >{val.cityName}</option>)
                })}
          </optgroup>
          </Select>
      </FormControl>
    </div>
  );
    }
